import React from 'react'
import './Item.css'
import { Link } from 'react-router-dom'

const Item = (Props) => {
  return (
    <div className='item'>
       <Link to={`/product/${props.id}`}> <img src={Props.image} alt="" /></Link>
        <p>{Props.name}</p>
        <div className="item-prices">
            <div className="item-price-new">
                Rs{Props.new_price}
                
            </div>
            <div className="item-price-old">
            Rs{Props.old_price}

            </div>

        </div>

      
    </div>
  )
}

export default Item
